import React from 'react'
import Logo from "../Assets/logo.png"
import {FaBars, FaTimes} from "react-icons/fa"

function Nav() {
  return (
    <div className="fixed w-full h-[1px] flex justify-between bg-[#FDE74C]">
      <div>
        <img src={Logo} alt="Logo image" style={{width: "120px", alignContent: "center"}} />

      </div>

    </div>
  )
}

export default Nav
